import React from "react";
import styled from "styled-components";

const SloganHeaderBlock = styled.div`
  display: block;
  padding-top: 10px;
  padding-left: 30px;
  padding-right: 10px;
  p {
    font-size: 1.5rem;
    font-weight: bold;
  }
`;

function Slogan_Header() {
  return (
    <SloganHeaderBlock>
      <p>EndLess Creation</p>
    </SloganHeaderBlock>
  );
}

export default Slogan_Header;
